module.exports = "<!-- <mat-card>\r\n  <mat-card-content [style.overflow]=\"'auto'\" [style.height.px]=\"'300'\">\r\n --><h1> Volunteer Area </h1>\r\n<p>\r\nThis will be a page where volunteers can collaborate. The default content displayed will be related to their own home community\r\nand the status of their contributions.\r\nThey can also browse content related to other communities. The page will include these elements:\r\n</p>\r\n<h3> List of current and past meetings and their status. </h3>\r\n<p>\r\nThis will show a listing of present and past meetings. It will show which have been processed and which still require work.\r\nIf the user selects a meeting, either the \"Work in Progres\" or \"Completed\" details components below will be shown.\r\n</p>\r\n\r\n<h3> Completed </h3>\r\n\r\nThis will show statistics on work that was completed: Number of volunteer contributing, time to complete, etc.\r\n\r\n<h3> Volunteer chat box </h3>\r\n<p>\r\nVolunteer who are logged in can chat among themselves. They can select to filter the chat room to see just those in thier own community,\r\ntheir own county, their own state, their own country or leave it open to everyone.\r\n</p>\r\n<!-- </mat-card-content>\r\n</mat-card>\r\n -->\r\n\r\n"

